import React from "react";
import Grid from '@material-ui/core/Grid';
import ClearIcon from '@material-ui/icons/Clear';
import "./index.scss";





export const TimeTable = () => {
    return (
        <div>
            <Grid container className='generalTimeTable'>
                <Grid item xs={3} className='limiteIzquierdo'>
                </Grid>
                <Grid item xs={6} className='tomoCentralSuperior'>
                    <h3 className='TextSuperiorIzquierda'>Agenda</h3>
                    <ClearIcon />
                </Grid>
                <Grid item xs={3} className='limiteDerecho'>
                </Grid>
            </Grid>
        </div>
    );
};
